import math

key_len = 120
CHALLENGE_CIPHERTEXT = ""
num_partitions = math.ceil(len(CHALLENGE_CIPHERTEXT) / key_len)

# 120 partitions

# (num_partitions - 1) ciphertexts encrypted with same K
for i in range(num_partitions):
    it = i * 120
    c_i = CHALLENGE_CIPHERTEXT[it : min(it + 120, len(CHALLENGE_CIPHERTEXT))]
    print(c_i)